import React from 'react'

function Header(props) {
  return (
    <header>
        <div className='container'>
            <h1>{props.text}</h1>
        </div>
    </header>
  )
}

//setting default props
Header.defaultProps = {
  text: 'FeedBack UI',
}

//Defininf proptypes
Header.PropTypes = {
  text: PropTypes.string,
}

export default Header
